import React from "react";
import {
  ContentContainer,
  PageContainer,
  Overlay,
  Title,
} from "./index_style.js";

function Home() {
  return (
    <ContentContainer>
      <PageContainer>
        <Overlay />
        <Title>Marview Inc.</Title>
      </PageContainer>
    </ContentContainer>
  );
}

export default Home;
